import ExpenseItem from './ExpenseItem';

function Expenses(expenses){

    return (
      <div>
        <ExpenseItem
          title={expenses.c[0].title}
          amount={expenses.c[0].amount}
          date={expenses.c[0].date}
        />
        <ExpenseItem
          title={expenses.c[1].title}
          amount={expenses.c[1].amount}
          date={expenses.c[1].date}
        />
        <ExpenseItem
          title={expenses.c[2].title}
          amount={expenses.c[2].amount}
          date={expenses.c[2].date}
        />
        <ExpenseItem
          title={expenses.c[3].title}
          amount={expenses.c[3].amount}
          date={expenses.c[3].date}
        />
      </div>
    );
}

export default Expenses;
